import React from 'react'
import Exp from './Exp'

function ExpList({ exps }) {
  return (
    <div>
      { exps.map( exp => {
        return <Exp key={ exp.id } exp={ exp.name } />
      }) }
    </div>
  )
}

export default ExpList
